    if (curriculo !== null && erro === null) {
        dadosCarregados = true;
    }

    return (
        <div className="container">
            <div className="row">
                <div className="col-md-8 col-md-offset-2 text-center fh5co-heading">
                </div>
            </div>
            <div className="row">
                <div className="col-md-4">
                    <ul className="info">
                        <li><span className="first-block">Nome:</span><span className="second-block">{ curriculo.nome }</span></li>
                        <li><span className="first-block">Telefone:</span><span className="second-block">{ curriculo.celular }</span></li>
