                        <li><span className="first-block">Endere√ßo:</span><span className="second-block">Sapucaia do Sul - RS</span></li>
                    </ul>
                </div>
                <div className="col-md-8">
                    
                </div>
            </div>
        </div>
    );
};

export default Sobre;
